import React from 'react';

const ProductData = (  item  ) => (
    <div>
            <img src={item.photo} alt={item.alt} />
            <h3>{item.name}</h3>
            <p>{item.price}</p>
            <p>{item.description}</p>
            <button>Add To Cart</button>
    </div>
);

export default ProductData;
